static uint8_t selected_color[2];

static void set_data_mode()
{
	GPIO_PORTA_DATA_R |= 0x80; // set PA7(D/C) to high
}

static void set_cmd_mode()
{
	GPIO_PORTA_DATA_R &= ~0x80; // set PA7(D/C) to low
}

static void write_data(uint8_t data[], unsigned size)
{
	set_data_mode();
	spi_write_wait(data, size);
}

static void write_cmd(uint8_t cmd, uint8_t args[], unsigned args_size,
		      uint32_t wait_ms)
{
	uint8_t cmd_arr[] = { cmd };

	set_cmd_mode();
	spi_write_wait(cmd_arr, sizeof(cmd_arr));

	if (args_size)
		write_data(args, args_size);

	if (wait_ms)
		systick_wait_1ms(wait_ms);
}

static void write_pixel()
{
	write_data(selected_color, sizeof(selected_color));
}

static void set_window(uint8_t x1, uint8_t x2, uint8_t y1, uint8_t y2)
{
	uint8_t col_data[4] = { 0 };
	uint8_t row_data[4] = { 0 };

	if (x2 >= MAX_WIDTH)
		x2 = MAX_WIDTH - 1;

	if (y2 >= MAX_WIDTH)
		y2 = MAX_HEIGHT - 1;

	col_data[1] = x1;
	col_data[3] = x2;

	row_data[1] = y1;
	row_data[3] = y2;

	write_cmd(CMD_CASET, col_data, sizeof(col_data), 0);
	write_cmd(CMD_RASET, row_data, sizeof(row_data), 0);
}

static void test_draw_pixel(uint8_t x, uint8_t y)
{
	set_window(0, MAX_WIDTH - 1, 0, MAX_HEIGHT - 1);
	write_cmd(CMD_RAMWR, 0, 0, 0); // write to ram

	while(1)
		write_pixel();
}

/*
 *   Color encoding
 *  red - green - blue
 *  5  -   6   -  5
 *  refer to section: 9.7.21
 */
void st7735r_set_color(uint16_t red, uint16_t green, uint16_t blue)
{
	red = red & 0x1F;
	green = green & 0x3F;
	blue = blue & 0x1F;

	/*           #1 byte                     #0 byte
	 * [red(5-bits),green(3-bits)] [green(3-bits),blue(5-bits)]
	*/
	selected_color[0] = (red << 3) | (green >> 3);
	selected_color[1] = (green << 5) | blue;
}

void st7735r_clear_display()
{
	uint16_t i;

	set_window(0, MAX_WIDTH - 1, 0, MAX_HEIGHT - 1);
	write_cmd(CMD_RAMWR, 0, 0, 0); // write to ram

// 	st7735r_set_color(0x1F, 0x3F, 0x1F); // white color
	st7735r_set_color(0x00, 0x00, 0x00); // black color
	for (i = 0; i < MAX_WIDTH * MAX_HEIGHT; i++)
		write_pixel();
}

void st7735r_draw_rectangle(uint8_t x1, uint8_t x2, uint8_t y1, uint8_t y2)
{
	uint16_t i;
	uint16_t pixels_count = (x2 - x1 + 1) * (y2 - y1 + 1);

	set_window(x1, x2, y1, y2);
	write_cmd(CMD_RAMWR, 0, 0, 0); // write to ram

	for (i = 0; i < pixels_count; i++)
		write_pixel();
}

// configure RST and D/C pins
static void init_control_pins(void)
{
	SYSCTL_RCGCGPIO_R |= SYSCTL_RCGCGPIO_R0;
	while ((SYSCTL_RCGCGPIO_R & SYSCTL_RCGCGPIO_R0) == 0);

	GPIO_PORTA_DEN_R |= 0xC0; // digital enable PA6-7
	GPIO_PORTA_DIR_R |= 0xC0; // set direction to output PA6-7

	GPIO_PORTA_DATA_R |= 0x40; // set PA6(RST) to high
}

static void init_display(void)
{
	uint8_t colmod_data[] = { 0x05 }; // color mode: 16-bit
	uint8_t madctl_data[] = { 0xA0 }; // rotate to left

	write_cmd(CMD_SWRST, 0, 0, 150); // software reset
	write_cmd(CMD_SLPOUT, 0, 0, 500); // sleep-out mode
	write_cmd(CMD_COLMOD, colmod_data, sizeof(colmod_data), 10);
	write_cmd(CMD_MADCTL, madctl_data, sizeof(madctl_data), 0); // rotate screen
	write_cmd(CMD_DISPON, 0, 0, 200); // display on
}

//------------ST7735_DrawBitmap------------
// Displays a 16-bit color BMP image.  A bitmap file that is created
// by a PC image processing program has a header and may be padded
// with dummy columns so the data have four byte alignment.  This
// function assumes that all of that has been stripped out, and the
// array image[] has one 16-bit halfword for each pixel to be
// displayed on the screen (encoded in reverse order, which is
// standard for bitmap files).  An array can be created in this
// format from a 24-bit-per-pixel .bmp file using the associated
// converter program.
// (x,y) is the screen location of the lower left corner of BMP image
// Requires (11 + 2*w*h) bytes of transmission (assuming image fully on screen)
// Input: x     horizontal position of the bottom left corner of the image, columns from the left edge
//        y     vertical position of the bottom left corner of the image, rows from the top edge
//        image pointer to a 16-bit color BMP image
//        w     number of pixels wide
//        h     number of pixels tall
// Output: none
// Must be less than or equal to 128 pixels wide by 160 pixels high
void st7735r_draw_bitmap(int16_t x, int16_t y, const uint16_t *image, int16_t w,
			 int16_t h) {

	// non-zero if columns need to be skipped due to clipping
	int16_t skipC = 0;

	// save this value; even if not all columns fit on the screen,
	// the image is still this width in ROM
	int16_t originalWidth = w;
	int i = w * (h - 1);
	uint8_t data[1];

	if ((x >= MAX_WIDTH) || ((y - h + 1) >= MAX_HEIGHT) || ((x + w) <= 0) ||
	    (y < 0)) {
		return;	 // image is totally off the screen, do nothing
	}
	if ((w > MAX_WIDTH) ||
	    (h > MAX_HEIGHT)) {	 // image is too wide for the screen, do nothing
		//***This isn't necessarily a fatal error, but it makes the
		// following logic much more complicated, since you can have
		// an image that exceeds multiple boundaries and needs to be
		// clipped on more than one side.
		return;
	}
	if ((x + w - 1) >= MAX_WIDTH) {	      // image exceeds right of screen
		skipC = (x + w) - MAX_WIDTH;  // skip cut off columns
		w = MAX_WIDTH - x;
	}
	if ((y - h + 1) < 0) {	// image exceeds top of screen
		i = i -
		    (h - y - 1) * originalWidth;  // skip the last cut off rows
		h = y + 1;
	}
	if (x < 0) {  // image exceeds left of screen
		w = w + x;
		skipC = -1 * x;	 // skip cut off columns
		i = i - x;	 // skip the first cut off columns
		x = 0;
	}
	if (y >= MAX_HEIGHT) {	// image exceeds bottom of screen
		h = h - (y - MAX_HEIGHT + 1);
		y = MAX_HEIGHT - 1;
	}

	set_window(x, x + w - 1, y - h + 1, y);
	write_cmd(CMD_RAMWR, 0, 0, 0); // write to ram

	for (y = 0; y < h; y = y + 1) {
		for (x = 0; x < w; x = x + 1) {
			// send the top 8 bits
			data[0] = image[i] >> 8;
			write_data(data, 1);

			// send the bottom 8 bits
			data[0] = image[i];
			write_data(data, 1);

			i = i + 1;  // go to the next pixel
		}
		i = i + skipC;
		i = i - 2 * originalWidth;
	}
}

void st7735r_init(void)
{
	pll_init_80mhz();
	systick_init();

	spi_init(MAIN_CLK_FQ_MHZ, SSI_CLK_FQ_MHZ);

	init_control_pins();

	init_display();

	st7735r_clear_display();
	st7735r_draw_bitmap(0, 127, mama, 160, 128);
}
